import React from 'react';
import Header_main from './components/Header_main'
import News_header from './components/News_header';
import Blog_main from './components/Blog_main';
import Navbar from './components/Navbar';
import Profil_page from './components/Profil_page';
import Blogers_page from './components/Blogers_page';

function App() {
  return (
    <body>
      <header>
          <Header_main/>
        </header>
      <main className='Main'>
        <aside>
          <Navbar/>
        </aside>
        <div class="content">
          <News_header/>
          <Blog_main/>
        </div>  
      </main>
      Bloger/>
    </body>
  );
  
}

export default App;
